 }
  return (
    <div className='Errorpage'>
      <div >
      <h1>404</h1>
      <h5>Sorry Page Not Found</h5>
      <Button variant="outline-dark" className='text-info' >GO TO Home</Button>
      </div>

      Error
    </div>
  )
}

